import Botao from '../Botao';
import  './GeradorNumeros.css'



function GerarNumeros() {


    function chamarTabela() {
        const Numeros = Array.from({ length: 25 }, (e, i) => i + 1).sort(() => Math.random() - 0.5).filter((e, i) => i < 15);
        const listaNumeros = Numeros.map((i) => <td>{i}</td>);
        return listaNumeros;
    }



    return(

       <><div className="container">
            <table className="table">

                <tr>
                    <th>Numeros Gerados</th>
                </tr>

                <td>
                    <table>
                        <tr>
                            {chamarTabela()}
                        </tr>
                    </table>
                </td>
            </table>
        </div><>
                <Botao onClick={chamarTabela} 
                >clicar</Botao>
            </></>




    )
}
export default GerarNumeros;
